import React from "react";

function about() {
  return (
    <div className="condiv about">
      <h1 className="subtopic">About Me</h1>

      <p>
        A Full Stack Developer with over 7 years of experience specializing in
        full-cycle web application development using React, Vue, Angular, .NET,
        JavaScript, and TypeScript. Proficient in designing and developing APIs,
        database systems, and optimizing UI/UX to enhance user experience.
        Strong ability to solve complex problems in both frontend and backend
        environments, with extensive experience working in Agile/Scrum settings.
      </p>
    </div>
  );
}

export default about;
